import "./styles.css";
import { types } from "mobx-state-tree";
import { observer } from "mobx-react";

const TodoModel = types
  .model({
    label: types.optional(types.string, ""),
    checked: types.optional(types.boolean, false)
  })
  .actions((self) => ({
    setLabel(label: string) {
      self.label = label;
    },
    setChecked(checked: boolean) {
      self.checked = checked;
    }
  }));

const todoModel = TodoModel.create();

const App = observer(() => {
  function addTodoFn(key: React.KeyboardEvent<HTMLInputElement>) {
    if (key.code === "Enter") {
      todoModel.setLabel(todoModel.input);
      todoModel.setChecked(false);
      todoModel.setInput("");
    }
  }

  return (
    <div className="App">
      <h1>Todo</h1>
      <input
        type="text"
        value={todoModel.label}
        onKeyPress={addTodoFn}
        onChange={({ target }) => todoModel.setLabel(target.value)}
      />

      <div>
        {todoModel.label && (
          <div>
            {todoModel.label}
            <input
              type="checkbox"
              checked={todoModel.checked}
              onChange={({ target }) => todoModel.setChecked(target.checked)}
            />
          </div>
        )}
      </div>
    </div>
  );
});

export default App;
